import React from "react";
import { FaTelegramPlane, FaYoutube, FaFacebookF } from "react-icons/fa";

const Footer = () => {
  return (
    <div className="bg-gradient-to-b from-teal-800 to-teal-900 text-white py-8">
      <div className="text-center mb-8">
        <p className="text-xl font-semibold">موقع ذاكر هو أحد حملات فريق خادم</p>
        <p className="text-lg">ربيع المحبين 1445</p>
      </div>
      <div className="flex justify-center space-x-6 text-2xl text-teal-200">
        <a href="#" className="hover:text-white transition-colors duration-300">
          <FaTelegramPlane />
        </a>
        <a href="#" className="hover:text-white transition-colors duration-300">
          <FaYoutube />
        </a>
        <a href="#" className="hover:text-white transition-colors duration-300">
          <FaFacebookF />
        </a>
      </div>
      <div className="text-center mt-8 text-sm text-teal-300">
        <p>تطوير فريق خادم - قسم البرمجة</p>
      </div>
    </div>
  );
};

export default Footer;
